// Build a basic image gallary with useReducer to allow users to navigate between image and display the current image.

import { useReducer } from "react";

const initialState = {
  currentImageIndex: 0,
};

const imageReducer = (state, action) => {
  switch (action.type) {
    case "NEXT_IMAGE":
      return {
        currentImageIndex: state.currentImageIndex + 1,
      };
    case "PREVIOUS_IMAGE":
      return {
        currentImageIndex: state.currentImageIndex - 1,
      };
    default:
      return state;
  }
};

const images = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
];

export const TwentyEight = () => {
  const [state, dispatch] = useReducer(imageReducer, initialState);

  const currentImage = images[state.currentImageIndex];

  return (
    <>
      <div>
        <h1>Image Gallery</h1>
        <div>
          <img src={currentImage} />
        </div>
        <div>
          <button onClick={() => dispatch({ type: "PREVIOUS_IMAGE" })}>
            Previous
          </button>
          <button onClick={() => dispatch({ type: "NEXT_IMAGE" })}>Next</button>
        </div>
      </div>
    </>
  );
};
